// globals
var vg;
var gImages = [];
var MY_TILE_IDX = 782;
var me;
var first_render = true;
var velocity = 10;

// event handlers

function onInit() {
  try {
    vg = new NanoVG();

    var images = [
      'hyptosis_tile-art-batch-1.png',
      'hyptosis_tile-art-batch-3.png',
      'hyptosis_til-art-batch-2.png',
      'hyptosis_tile-art-batch-4.png',
      'hyptosis_tile-art-batch-5.png',
      'hyptosis_sprites_organized.png'
    ];

    images.forEach(function(filename) {
      var imageId = vg.createImage("../game/images/" + filename, 0);
      gImages.push(imageId);
    });
  } catch(e) {
    print(e.stack);
  }
}

function onQuit() {
  var num_images = gImages.length;
  for (var i = 0; i < num_images; i++) {
    vg.deleteImage(gImages[i]);
  }
  gImages = [];
}

this.addEventListener('click', function(evt) {
  me.target_x = evt.clientX;
  me.target_y = evt.clientY;
});

function onDraw() {
  try {
    //drawLabel(vg, "Diameter", x,y, 280,20);
    renderLayers(vg, level2, level2.layers);
  } catch(e) {
    print(e.stack);
  }
}

// helper functions

function setupMe(x, y, width, height, offset_x, offset_y, tileset_ix) {
  if (me) return;
  me = {x: x, y: y, width: width, height: height, offset_x: offset_x, offset_y: offset_y, tileset_ix: tileset_ix};
}

function drawLabel(vg, text, x, y, w, h)
{
  vg.fontSize(18.0);
  vg.fontFace("sans");
  vg.fillColor(255,255,255,128);

  vg.textAlign(vg.ALIGN_LEFT|vg.ALIGN_MIDDLE);
  vg.text(x,y+h*0.5,text);
}

function drawImage(vg, x, y, width, height, crop_x, crop_y, tileset_ix) {
  if (!gImages.length)
    return;

  var image = gImages[tileset_ix];
  var size = vg.imageSize(image);
  var img_width = size.width;
  var img_height = size.height

  vg.beginPath();
  vg.rect(x, y, width, height);
  var alpha = 1.0;
  var rotation = 0.0;
  vg.imagePattern(x - crop_x, y - crop_y, img_width, img_height, rotation, image, alpha);
  vg.fill();
}

// tilemap handling (from http://stackoverflow.com/questions/15667588/reading-json-tiled-map-editor-file-and-displaying-to-canvas)
function renderLayers(vg, level, layers) {
  level.tileset_first_gids = level.tilesets.map(function(tileset) {
    return tileset.firstgid;
  });
  //renderLayer(vg, level, layers[1]);
  layers.forEach(renderLayer.bind(null, vg, level));
  if (me) {
    if (me.x < me.target_x - velocity)
      me.x += velocity;
    else if (me.x > me.target_x + velocity)
      me.x -= velocity;
    if (me.y < me.target_y - velocity)
      me.y += velocity;
    else if (me.y > me.target_y + velocity)
      me.y -= velocity;
    drawImage(vg, me.x, me.y, me.width, me.height, me.offset_x, me.offset_y, me.tileset_ix);
  }
  first_render = false;
}

function renderLayer(vg, level, layer) {
    if (layer.type !== "tilelayer" || !layer.opacity) {
        alert("Not a tileLayer");
    }
    var size = level.tilewidth;

        layer.data.forEach(function(tile_idx, i) {
            if (!tile_idx) return;
            var is_me = tile_idx == MY_TILE_IDX;

            var num_tilesets = level.tilesets.length;
            var tileset_ix;
            for (tileset_ix = 0; tileset_ix < num_tilesets; tileset_ix++) {
              // we went too far, backout the tileset_ix & break
              if (tile_idx < level.tileset_first_gids[tileset_ix])
                break;
            }
            tileset_ix--; // back out one b/c we either went too far or hit the last tileset_ix++

            tile_idx -= level.tileset_first_gids[tileset_ix];
            tile_idx++; // add 1 b/c the first_gids are 1-based

            var img_x, img_y, s_x, s_y,
                tile = level.tilesets[tileset_ix];
            tile_idx--;
            offset_x = (tile_idx % (tile.imagewidth / size)) * size;
            offset_y = ~~(tile_idx / (tile.imagewidth / size)) * size;

            var x = (i % layer.width) * size;
            var y = ~~(i / layer.width) * size;

            if (is_me)
              setupMe(x, y, size, size, offset_x, offset_y, tileset_ix);
            else if (first_render || closeToMe(x, y))
              drawImage(vg, x, y, size, size, offset_x, offset_y, tileset_ix);
        });
}

function closeToMe(x, y) {
  var delta = velocity * 15;
  return (x > me.x - delta && x < me.x + delta) && (y > me.y - delta && y < me.y + delta);
}

